import Navbar from "./Navbar";
import Sidebar from "./Sidebar";

export default function Layout({ title, children }) {
  return (
    <div>
      <Navbar />
      <div className="d-flex">
        <Sidebar />
        <main className="flex-grow-1 p-4">
          <h4>{title}</h4>
          {children}
        </main>
      </div>
    </div>
  );
}
